  const currentPath = window.location.pathname;

  return (
    <Router>
      <div>
        <div className='h-nbar'>
          <div className='et-title'>
            <text>etisalat by e&</text>
          </div>
        </div>
        <VerticalMenu />

        {currentPath === '/chat' && <Chat />}
        {/* Render other components based on the currentPath */}

      </div>
    </Router>
  );
}

export default App;
